import React from 'react';
import 'antd/dist/antd.css';
import '../App.css'
import { Table, Tag, Space } from 'antd';

const { Column, ColumnGroup } = Table;

const data = [
  {
    key: '1',
    ranking: '1',
    teamName: 'Team 1',
    scores: 80000,
    tags: ['Golden'],
  },
  {
    key: '2',
    ranking: '2',
    teamName: 'Team 2',
    scores: 70000,
    tags: ['Silver'],
  },
  {
    key: '3',
    ranking: '3',
    teamName: 'Team 3',
    scores: 50000,
    tags: ['Bronze'],
  },
  {
    key: '4',
    ranking: '34',
    teamName: 'Team 3',
    scores: 10000,
    tags: ['Bronze'],
  },
];
class TeamScoreBoard extends React.Component {
  render() {
    return(
    <Table dataSource={data}>
    <Column title="Ranking" dataIndex="ranking" key="ranking" />
    <Column title="Team Name" dataIndex="teamName" key="teamName" />
    <Column title="Scores" dataIndex="scores" key="scores" />
    <Column
      title="Tags"
      dataIndex="tags"
      key="tags"
      render={tags => (
        <>
          {tags.map(tag => (
            <Tag color="blue" key={tag}>
              {tag}
            </Tag>
          ))}
        </>
      )}
    />
    <Column
      title="Action"
      key="action"
      render={(text, record) => (
        <Space size="middle">
          <a>Team Details</a>
      
        </Space>
      )}
    />
  </Table>
    );
  }
}

 
export default TeamScoreBoard;
